import React from 'react';

const Frame9 = () => {
  return (
    <div
      style={{
        width: '1440px',
        minHeight: '974px',
        background: 'linear-gradient(to bottom, #fff3ef 0%, #ffffff 40%)',
        padding: '97px 271px',
        display: 'flex',
        flexDirection: 'column',
        gap: '10px',
        boxSizing: 'border-box',
      }}
    >
      {/* Frame9 content goes here */}
      <div style={{ color: '#1C264C', fontSize: '32px', fontWeight: 600 }}>Frame9 Placeholder</div>
    </div>
  );
};

export default Frame9;
